import React from "react";

class Football extends React.Component {
  red() {
    alert("I am red!");
  }
  blue() {
    alert("I am blue!");
  }
  yellow() {
    alert("I am yellow!");
  }

  purple() {
    alert("I am purple!");
  }
  pink() {
    alert("I am pink!");
  }
  orange() {
    alert("I am orange!");
  }
  black() {
    alert("I am black!");
  }
  white() {
    alert("I am white!");
  }
  grey() {
    alert("I am grey!");
  }
  render() {
    return (
      <>
        <button
          style={{
            backgroundColor: "red",
            width: "150px",
            height: "60px",
            margin: "20px",
          }}
          onClick={this.red}
        >
          Check I am red!
        </button>
        <button style={{ backgroundColor: "blue" }} onClick={this.blue}>
          Check I am blue!
        </button>
        <button style={{ backgroundColor: "yellow" }} onClick={this.yellow}>
          Check I am red!
        </button>
        <button style={{ backgroundColor: "purple" }} onClick={this.purple}>
          Check I am blue!
        </button>
        <button style={{ backgroundColor: "pink" }} onClick={this.pink}>
          Check I am red!
        </button>
        <button style={{ backgroundColor: "orange" }} onClick={this.orange}>
          Check I am blue!
        </button>
        <button style={{ backgroundColor: "lighblue" }} onClick={this.lighblue}>
          Check I am red!
        </button>
        <button style={{ backgroundColor: "grey" }} onClick={this.grey}>
          Check I am blue!
        </button>
        <button style={{ cobackgroundColorlor: "white" }} onClick={this.white}>
          Check I am blue!
        </button>
      </>
    );
  }
}
export default Football;
